import React, { Component } from "react";
import Jumbotron from "../Jumbotron"

function Title(title, subtitle){
        return (
					<Jumbotron>
						<h1 className="text-center">{title}</h1>
						<h2 className="text-center">{subtitle}</h2>
					</Jumbotron>
        )
      }

export default Title;
